import React, { Component } from 'react';

class Serachbar extends Component {
  render() {
    return <div className='form-row mb-5'>
      <div className='col-12'>
      <input type="text"  className='input-group' placeholder='Search movie'></input>
      </div>  
    </div>;
  }
}
export default Serachbar;
